import ReturnSignInRegister from './SignIn';
import { auth } from '../../firebase';
import SignUp from '../../Sign/Main';

// Export View SignIn
export default function SignInRegister() {

 const [people, setPleople] = React.useState();
 const user = auth.currentUser;
 React.useEffect(() => {
  setPleople(user);
 }, []);

 return (
  <>
   {people ? <ReturnSignInRegister /> : <SignUp />}
  </>
 );
};
